class Transaccion {

    transferir() {
        let inf = new FormData();
        inf.append("cuentaReceptor", $("#cuentaReceptor").val().trim());
        inf.append("cedulaReceptor", $("#cedulaReceptor").val().trim());
        inf.append("monto", $("#monto").val().trim());
        inf.append("cuentaPropia", $("#cuentas option:selected").attr("id"));
        inf.append("controlador", "Transaccion");
        inf.append("accion", "transferir");
        //console.log($("#cuentaReceptor").val().trim() + " " + $("#cedulaReceptor").val().trim() + " " + $("#cuentas option:selected").attr("id") + " " + $("#monto").val().trim());
        $.ajax({
            type: "POST",
            url: "../../../controladores/Frontal.php",
            contentType: false,
            data: inf,
            processData: false,
            cache: false,
            success: function (response) {
                if (response != 'Error al actualizar datos de la cuenta que recibe' && response != 'Error al actualizar datos de la cuenta que envia' && response != 'Error al realizar la transferencia'
                    && response != 'No posee saldo suficiente' && response != "El destinatario no esta asociado al banco") {
                    let recibo = JSON.parse(response);
                    $("#modalRecibo").modal("show")
                    $("input[type=text]").val("");
                    $("#contenedorModal").append("<div class='row'><div class='col-6 justify-content-center border border-dark'><h5 class='text-center'>Cuenta de envio: </h5>" +
                        "<h6 class='text-center'>" + recibo.cuentaE + "</h6></div><div class='col-6 justify-content-center border border-dark'><h5 class='text-center'>Cuenta receptora : </h5>" +
                        "<h6 class='text-center'>" + recibo.cuentaR + "</h6></div><div class='col-6 justify-content-center border border-dark'><h5 class='text-center'>Fecha :</h5><h6 class='text-center'>" + recibo.fecha + "</h6>" +
                        "</div><div class='col-6 justify-content-center border border-dark'><h5 class='text-center'>Saldo Actual</h5><h6 class='text-center'>" + recibo.saldoEnvia + "</h6></div></div>");
                } else {
                    alert(response);
                }
            }

        });
    }
    depositar() {
        let inf = new FormData();
        inf.append("monto", $("#monto").val().trim());
        inf.append("cuentaPropia", $("#cuentas option:selected").attr("id"));
        inf.append("controlador", "Transaccion");
        inf.append("accion", "depositar");
        $.ajax({
            type: "POST",
            url: "../../../controladores/Frontal.php",
            contentType: false,
            data: inf,
            processData: false,
            cache: false,
            success: function (response) {
                if (response != ' Error al actualizar datos de la cuenta donde se depositara' && response != 'Error al realizar el deposito' && response != "El destinatario no esta asociado al banco") {
                    let recibo = JSON.parse(response);
                    $("#modalRecibo").modal("show")
                    $("input[type=text]").val("");
                    let htmlRecibo = "<div class='row'><div class='col-12 justify-content-center border border-dark'><h5 class='text-center'>Cuenta de envio: </h5>" +
                        "<h6 class='text-center'>" + recibo.cuentaE + "</h6></div>" +
                        "<div class='col-12 justify-content-center border border-dark'><h5 class='text-center'>Fecha :</h5><h6 class='text-center'>" + recibo.fecha + "</h6>" +
                        "</div><div class='col-12 justify-content-center border border-dark'><h5 class='text-center'>Saldo Actual</h5><h6 class='text-center'>" + recibo.saldoEnvia + "</h6></div></div>";
                    $("#contenedorModal").append(htmlRecibo);
                    return recibo;
                } else {

                    alert(response);
                }
            }

        });
    }
    retirar() {
        let inf = new FormData();
        inf.append("monto", $("#monto").val().trim());
        inf.append("cuentaPropia", $("#cuentas option:selected").attr("id"));
        inf.append("controlador", "Transaccion");
        inf.append("accion", "retirar");
        $.ajax({
            type: "POST",
            url: "../../../controladores/Frontal.php",
            contentType: false,
            data: inf,
            processData: false,
            cache: false,
            success: function (response) {
                if (response != ' Error al actualizar datos de la cuenta de donde se retirara dinero' && response != 'Error al realizar el retiro' && response != 'No posee saldo suficiente para realizar el retiro de dinero') {
                    let recibo = JSON.parse(response);
                    $("#modalRecibo").modal("show")
                    $("input[type=text]").val("");
                    $("#contenedorModal").append("<div class='row'><div class='col-12 justify-content-center border border-dark'><h5 class='text-center'>Cuenta del retiro: </h5>" +
                        "<h6 class='text-center'>" + recibo.cuentaE + "</h6></div>" +
                        "<div class='col-12 justify-content-center border border-dark'><h5 class='text-center'>Fecha :</h5><h6 class='text-center'>" + recibo.fecha + "</h6>" +
                        "</div><div class='col-12 justify-content-center border border-dark'><h5 class='text-center'>Saldo Actual</h5><h6 class='text-center'>" + recibo.saldoEnvia + "</h6></div></div>");
                } else {

                    alert(response);
                }
            }

        });
    }
    pagarServicio() {
        let inf = new FormData();
        inf.append("monto", $("#monto").val().trim());
        inf.append("codigo", $("#codigo").val().trim());
        inf.append("cuentaPropia", $("#cuentas option:selected").attr("id"));
        inf.append("idservicio", $("#servicios option:selected").attr("id"));
        inf.append("controlador", "Transaccion");
        inf.append("accion", "pagarServicio");
        $.ajax({
            type: "POST",
            url: "../../../controladores/Frontal.php",
            contentType: false,
            data: inf,
            processData: false,
            cache: false,
            success: function (response) {
                if (response != ' Error al actualizar datos de la cuenta que envia' && response != 'Error al realizar el pago' && response != 'No posee saldo suficiente') {
                    let recibo = JSON.parse(response);
                    $("#modalRecibo").modal("show")
                    $("input[type=text]").val("");
                    $("#contenedorModal").append("<div class='row'><div class='col-6 justify-content-center border border-dark'><h5 class='text-center'>Cuenta en la que se deposito: </h5>" +
                        "<h6 class='text-center'>" + recibo.cuentaE + "</h6></div><div class='col-6 justify-content-center border border-dark'><h5 class='text-center'>Servicio</h5><h6 class='text-center'>" + $("#servicios option:selected").val() + "</h6></div>" +
                        "<div class='col-6 justify-content-center border border-dark'><h5 class='text-center'>Fecha :</h5><h6 class='text-center'>" + recibo.fecha + "</h6></div>" +
                        "<div class='col-6 justify-content-center border border-dark'><h5 class='text-center'>Monto pagado :</h5><h6 class='text-center'>" + recibo.monto + "</h6></div>" +
                        "<div class='col-12 justify-content-center border border-dark'><h5 class='text-center'>Saldo Actual</h5><h6 class='text-center'>" + recibo.saldoEnvia + "</h6></div></div></div>");
                } else {

                    alert(response);
                }
            }

        });
    }

    generarTicket() {
        let doc = new jsPDF('p', 'mm', [150, 150])
        let imgData = 'data:image/png;base64,';
        doc.addImage(imgData, 'JPEG', 0, 10, 150, 150);
        doc.text(50, 20, 'Ticket de la transaccion ');
        doc.text(50, 120, 'Banco Del Zulia CA ');
        $("#cuerpoModal").css("background-color", "#ffffff");
        doc.addHTML($("#cuerpoModal").get(0), 0, 40, function () {
            doc.save('CajeroBancoDelZulia' + sessionStorage.getItem('idusuario') + '.pdf');
        });
    }
    mostrarTransacciones() {

        let inf = new FormData();
        inf.append("cuentaPropia", $("#cuentas option:selected").attr("id"));
        inf.append("controlador", "Transaccion");
        inf.append("accion", "mostrarTransacciones");
        $.ajax({
            type: "POST",
            url: "../../../controladores/Frontal.php",
            contentType: false,
            data: inf,
            processData: false,
            cache: false,
            success: function (response) {
                if (response != 'Error al enviar parametros' && response != 'Problemas al cargar sus transacciones') {

                    let transacciones = JSON.parse(response);
                    for (let i = 0; i < transacciones.length; i++) {
                        $("#tBodyTrans").append("<tr><td>" + transacciones[i].id + "</td><td>" + transacciones[i].numero + "</td><td>" + transacciones[i].tipo + "</td><td>" + transacciones[i].fecha + "</td><td>" + transacciones[i].cantidad + "</td></tr>");
                    }

                }

            }

        });
    }
    mostrarTransaccionesAdmin() {

        let inf = new FormData();
        inf.append("controlador", "Transaccion");
        inf.append("accion", "mostrarTransaccionesAdmin");
        inf.append("numeroCuenta", $("#muestra").val().trim());
        //console.log($("#muestra").val().trim());
        $.ajax({
            type: "POST",
            url: "../../../controladores/Frontal.php",
            contentType: false,
            data: inf,
            processData: false,
            cache: false,
            success: function (response) {
                if (response != 'Error al enviar parametros' && response != 'No tiene transacciones' && response != '0') {
                    let transacciones = JSON.parse(response);
                    for (let i = 0; i < transacciones.length; i++) {
                        $("#tBodyTrans").append("<tr><td>" + transacciones[i].id + "</td><td>" + transacciones[i].numero + "</td><td>" + transacciones[i].tipo + "</td><td>" + transacciones[i].fecha + "</td><td>" + transacciones[i].cantidad + "</td></tr>");
                    }

                } else {
                    alert("No hay transacciones");

                }

            }

        });
    }
}

